package com.syntax.replit.solutions;

public class repl67NestedIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 for (int a=1; a<=5; a++) {     //starts with this value 1 by 1
		      for (int b=1; b<=10; b++){ //then goes to this value until false
		          System.out.print(a*b+" ");      
		      }
		    System.out.println();
		      }
		  }
	}


